class Client {
    constructor(name, houseNumber, address, city, cep, district, tel, email, paymentMethod, discount, fees) {
        this.name = name;
        this.houseNumber = houseNumber;
        this.address = address;
        this.city = city;
        this.cep = cep;
        this.district = district;
        this.tel = tel;
        this.email = email;
        this.paymentMethod = paymentMethod;
        this.discount = discount;
        this.fees = fees;
    };
};  